import React, { useState, useEffect, useRef } from 'react';
import { motion } from 'framer-motion';
import {
  FaHome, FaUser, FaGraduationCap,
  FaProjectDiagram, FaCertificate, FaMedal, FaEnvelope,
  FaChevronDown, FaChevronUp
} from 'react-icons/fa';
import { Link as ScrollLink } from 'react-scroll';

const navLinks = [
  { name: 'Home', icon: <FaHome />, to: 'hero' },
  { name: 'About', icon: <FaUser />, to: 'about' },
  { name: 'Education', icon: <FaGraduationCap />, to: 'education' },
  {
    name: 'Projects',
    icon: <FaProjectDiagram />,
    to: 'projects',
    dropdown: [
      { name: 'Projects', to: 'projects', icon: <FaProjectDiagram /> },
      { name: 'Certificates', to: 'certificates', icon: <FaCertificate /> },
      { name: 'Badges', to: 'badges', icon: <FaMedal /> },
    ]
  },
  { name: 'Contact', icon: <FaEnvelope />, to: 'contact' },
];

const Navbar = () => {
  const [activeLink, setActiveLink] = useState('Home');
  const [showDropdown, setShowDropdown] = useState(false);
  const dropdownRef = useRef(null);

  const handleSetActive = (to) => {
    setActiveLink(to.charAt(0).toUpperCase() + to.slice(1));
  };

  useEffect(() => {
    const handleClickOutside = (event) => {
      if (dropdownRef.current && !dropdownRef.current.contains(event.target)) {
        setShowDropdown(false);
      }
    };
    document.addEventListener('mousedown', handleClickOutside);
    return () => document.removeEventListener('mousedown', handleClickOutside);
  }, []);

  return (
    <motion.nav
      className="fixed top-4 left-1/2 transform -translate-x-1/2 z-50 bg-white/10 backdrop-blur-xl border border-white/20 shadow-lg rounded-full px-6 py-2 flex items-center space-x-6 sm:space-x-8 text-white"
      initial={{ y: -60, opacity: 0 }}
      animate={{ y: 0, opacity: 1 }}
      transition={{ duration: 0.6 }}
    >
      {navLinks.map(({ name, icon, to, dropdown }) => (
        <motion.div
          key={name}
          className={`relative flex items-center gap-1 cursor-pointer transition duration-200 ${
            activeLink === name ? 'text-yellow-300' : 'hover:text-yellow-300'
          }`}
          whileHover={{ scale: 1.1 }}
          ref={name === 'Projects' ? dropdownRef : null}
        >
          {!dropdown ? (
            <ScrollLink
              to={to}
              smooth
              duration={500}
              offset={-100}
              onSetActive={handleSetActive}
              className="flex items-center gap-1"
            >
              <span className="text-lg">{icon}</span>
              <span className="hidden sm:inline">{name}</span>
            </ScrollLink>
          ) : (
            <>
              <div
                onClick={() => setShowDropdown((prev) => !prev)}
                className="flex items-center gap-1"
              >
                <span className="text-lg">{icon}</span>
                <span className="hidden sm:inline">{name}</span>
                {showDropdown ? (
                  <FaChevronUp className="ml-1 text-xs" />
                ) : (
                  <FaChevronDown className="ml-1 text-xs" />
                )}
              </div>

              {showDropdown && (
                <motion.ul
                  className="absolute top-10 left-0 bg-white/10 backdrop-blur-md border border-white/30 rounded-lg shadow-lg w-52 text-sm p-2 z-50"
                  initial={{ opacity: 0, y: -10 }}
                  animate={{ opacity: 1, y: 0 }}
                  transition={{ duration: 0.2 }}
                >
                  {dropdown.map((item) => (
                    <a
                      key={item.name}
                      href={`/#projects?tab=${item.to}`}
                      onClick={() => setShowDropdown(false)}
                      className="flex items-center gap-2 p-2 hover:bg-white/20 rounded cursor-pointer text-white hover:text-yellow-300"
                    >
                      <span>{item.icon}</span> {item.name}
                    </a>
                  ))}
                </motion.ul>
              )}
            </>
          )}
        </motion.div>
      ))}
    </motion.nav>
  );
};

export default Navbar;
